class SignPdfResponse {
  final String signedFileBase64;

  SignPdfResponse({required this.signedFileBase64});

  factory SignPdfResponse.fromJson(Map<String, dynamic> json) {
    return SignPdfResponse(
      signedFileBase64: json['signedFileBase64'],
    );
  }
}

